function Header()
{
  return <header><h1>ExchangeRate</h1></header>;
}

function UserInput()
{
  return <label><input className='CurrencyName'></input></label>
}

function ExchangeButton()
{
  return <button className='ExchangeButton'><img src=''></img></button>
}
